import {Component} from 'react'
import './sample.txt'

class Header extends Component{

    fun = ()=> {
        fetch('samplefile.txt')
        .then((response)=>{
            return response.text()
        })
        .then((data)=>{
            console.log(data)
        })
        .catch(e => {
            console.log(e)
        })

    }
    render(){
        return(
            <div>
                <p>hello world</p>
                <button onClick={this.fun}>click</button>
            </div>
        )
    }
}
export default Header
